/// <reference path="../references.ts" />

class Splash extends Quartz.State
{
    public static STATE_NAME: string = 'splash';

    constructor()
    {
        super();

        this.addChild(new PIXI.Sprite(this.getRadialGradientTexture()));

        var container = new Quartz.PinnedContainer();
        container.setPinned(
            () => Constants.GAME_WIDTH / 2,
            () => Constants.GAME_HEIGHT / 3
        );
        this.addChild(container);

        //Setup the spinning gembly logo
        var shadow = PIXI.Sprite.fromImage(this.splashLogo);
        shadow.y -= 30;
        shadow.scale.set(0, 0);
        shadow.anchor = new PIXI.Point(0.5, 0.5);
        container.addChild(shadow);

        var logo: PIXI.extras.MovieClip = this.getLogo();
        logo.y -= 35;
        logo.anchor = new PIXI.Point(0.5, 0.5);
        logo.animationSpeed = 0.2;
        logo.scale.set(0, 0);
        container.addChild(logo);

        var t = new PIXI.Text('EXCITINGLY FUN!', <PIXI.TextStyle>{
            font: "18px 'Aller Display'",
            fill:'white', stroke: 'black',
            strokeThickness: 2
        });
        t.y += 30;
        t.anchor.set(0.5, 0.5);
        t.scale.set(0, 0);
        container.addChild(t);

        var loader = new Quartz.AssetLoader(Images.preloadList, null, null, config.baseUrl);
        loader.onProgress = (evt: any) => {
            var prct = Math.round ((evt.loaded / evt.total) * 100);
            //GameAnalytics.getInstance().addEvent(new DesignEvent("Flow:Splash:" + prct));
        };
        loader.onComplete = (evt:any) => {
            TweenLite.to(shadow, 1, {scaleX: 0, scaleY: 0, ease: Back.easeIn});
            TweenLite.to(logo, 1, {scaleX: 0, scaleY: 0, ease: Back.easeIn, onComplete: () => {
                Quartz.StateManager.getInstance()
                    .playState(Preload.STATE_NAME, new Preload())
                    .removeState(Splash.STATE_NAME);
            }});
            TweenLite.to(t, 0.8, {scaleX: 0, scaleY: 0, ease: Back.easeIn});
            //GameAnalytics.getInstance().addEvent(new DesignEvent("Flow:Splash:100"));
        };

        //Show splash and start loading
        TweenLite.to(shadow, 1, {scaleX: 0.7, scaleY: 0.7, ease: Back.easeOut});
        TweenLite.to(logo, 1, {scaleX: 1, scaleY: 1, ease: Back.easeOut, onComplete: () => {
            logo.play();
            loader.load();
        }});
        TweenLite.to(t, 0.8, {scaleX: 1, scaleY: 1, delay: 0.2, ease: Back.easeOut});
        //GameAnalytics.getInstance().addEvent(new DesignEvent("Flow:Splash:0"));
    }

    /**
     * Creates an offscreen canvas to render the gradient, because PIXI doesn't do it itself
     * Still fast as hell tho
     *
     * @returns {Texture}
     */
    private getRadialGradientTexture():PIXI.Texture
    {
        //Create the canvas and get the context
        var canvas:HTMLCanvasElement = document.createElement('canvas');
        canvas.width = Constants.GAME_WIDTH;
        canvas.height = Constants.GAME_HEIGHT;
        var ctx:CanvasRenderingContext2D = <CanvasRenderingContext2D>canvas.getContext('2d');

        var filter: PIXI.filters.DropShadowFilter = new PIXI.filters.DropShadowFilter();

        //Set up the gradient
        var gradient:CanvasGradient = ctx.createRadialGradient(
            Constants.GAME_WIDTH / 2,
            Constants.GAME_HEIGHT / 3,
            0,
            Constants.GAME_WIDTH / 2,
            Constants.GAME_HEIGHT / 3,
            Math.max(Constants.GAME_WIDTH / 2, Constants.GAME_HEIGHT / 2)
        );
        gradient.addColorStop(0, 'rgba(71, 71, 71, 1.000)');
        gradient.addColorStop(0.5, 'rgba(23, 23, 23, 1.000)');

        ctx.fillStyle = gradient;
        ctx.fillRect(0, 0, Constants.GAME_WIDTH, Constants.GAME_HEIGHT);

        //Return the newly create Texture, ready for usage!
        return PIXI.Texture.fromCanvas(canvas);
    }


    /**
     * Fetches a base64'd logo movieclip and prepares it for use
     *
     * @returns {PIXI.extras.MovieClip}    The logo we want to show during preloading
     */
    private getLogo(): PIXI.extras.MovieClip
    {
        var logoImg = PIXI.BaseTexture.fromImage(this.splashImage);

        return new PIXI.extras.MovieClip([
            new PIXI.Texture(logoImg, new PIXI.Rectangle(0, 1, 272, 89)),
            new PIXI.Texture(logoImg, new PIXI.Rectangle(0, 91, 272, 89)),
            new PIXI.Texture(logoImg, new PIXI.Rectangle(0, 181, 272, 89)),
            new PIXI.Texture(logoImg, new PIXI.Rectangle(0, 271, 272, 89))
        ]);
    }

    /**
     * Called when the canvas resizes
     *
     * @param width     The new width of the canvas
     * @param height    The new height of the canvas
     */
    public onResize(width: number, height: number)
    {
        super.onResize(width, height);
    }

    /**
     * The logo image that should be used for the preloader splash
     */
    private splashImage: string = 'data:image/png;base64,';

    private splashLogo: string = 'data:image/png;base64,';

}